import React from "react";
import ReactDOM from "react-dom";
import 'antd/dist/antd.css'
import { Button, DatePicker, version } from "antd";
import "antd/dist/antd.css";
import "./index.css";

ReactDOM.render(
    <div className="App">

        <DatePicker />
        <Button type="primary" style={{ marginLeft: 8 }}>
            Primary Button
        </Button>
    </div>,
    document.getElementById("root")
);
